import Vue from 'vue'

import ThemeLayout from '@themeLayout'
import ThemeNotFound from '@themeNotFound'
import { injectMixins } from '@app/util'
import rootMixins from '@app/root-mixins'

injectMixins(ThemeLayout, rootMixins)
injectMixins(ThemeNotFound, rootMixins)

export const routes = [
  {
    name: "v-9b4ec0e0840ff",
    path: "/",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("E:\\github\\start-vuepress\\docs\\README.md").then(comp => {
        Vue.component("v-9b4ec0e0840ff", comp.default)
        next()
      })
    }
  },
  {
    path: "/index.html",
    redirect: "/"
  },
  {
    name: "v-db4b5571a7bd9",
    path: "/cssdoc/",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("E:\\github\\start-vuepress\\docs\\cssdoc\\README.md").then(comp => {
        Vue.component("v-db4b5571a7bd9", comp.default)
        next()
      })
    }
  },
  {
    path: "/cssdoc/index.html",
    redirect: "/cssdoc/"
  },
  {
    name: "v-69df1fa50b532",
    path: "/jsdoc/",
    component: ThemeLayout,
    beforeEnter: (to, from, next) => {
      import("E:\\github\\start-vuepress\\docs\\jsdoc\\README.md").then(comp => {
        Vue.component("v-69df1fa50b532", comp.default)
        next()
      })
    }
  },
  {
    path: "/jsdoc/index.html",
    redirect: "/jsdoc/"
  },
  {
    path: '*',
    component: ThemeNotFound
  }
]
